import React from 'react';
import ProgressBar from 'react-bootstrap/ProgressBar';
class Tutorialscore extends React.Component{
    constructor(props){
        super(props);
        this.state=props;
        console.log(this.state)
    }
    render(){
        return(
           <tr>
               <td>{this.state.tutorial_name}</td><td><ProgressBar><ProgressBar animated variant="success" now={40} key={1} /><ProgressBar variant="warning" now={60} key={2} /></ProgressBar></td>
           </tr>
        )
    }
}
export default Tutorialscore;
